import React from "react";
import styled from "styled-components";

import {
  Container,
  Title,
  Button,
  Left,
  Right,
  Body,
  Icon,
  Text,
  Thumbnail,
} from "native-base";
import { View, StyleSheet, Image } from "react-native";

const ContentContainer = ({ navigation, result, sizeBig }) => {
  return (
    <View style={styles.container}>
      <ThumbNail size={sizeBig} source={{ uri: result.thumbNail }} />
      <Text>{result.title}</Text>
      <View style={styles.trainerContainer}>
        <Thumbnail
          style={styles.trainerThumb}
          small
          source={{
            uri: result.trainerPic,
          }}
        />
        <Text style={{ fontSize: 13 }}>{result.trainer}</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    display: "flex",
    marginTop: 10,
    marginBottom: 10,
    marginRight: 20,
  },
  trainerContainer: {
    flexDirection: "row",
    marginTop: 7,
    alignItem: "center",
  },
  trainerThumb: {
    width: 24,
    height: 24,
    marginRight: 10,
  },
});

const ThumbNail = styled.Image`
  width: ${({ size }) => (size ? 170 : 150)};
  height: ${({ size }) => (size ? 150 : 150)};
  border-radius: 4;
  margin-bottom: 5;
`;

export default ContentContainer;
